nds":"0","isLive":true,"channelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isOwnerViewing":false,"shortDescription":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/"},"lengthSeconds":"0","ownerProfileUrl":"http://www.youtube.com/@forppgcpr","externalChannelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","is EECowhSw==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI97rS6sLZkAMVqkhIAB1mlyyHygEECowhSw==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI97rS6sLZkAMVqkhIAB1mlyyHSOnD7pmTgvCiDcoBBAqMIUs=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblRUa284R1ZfU2ZibU50bXlqT09WWVhKdmpzQXxBQ3Jtc0trS3huRTFKREc3MlEybEU5aVdxdHNRVWVsV3FDUUxTUzZZVUpQR2hBWUdoNDJsb0w4U0xVWU5nVG5uZEVxejgtMGhlYU96N00yMVBKT25xMWVUeGg5SGFfWlZ6QmR3NHRITkVETlBMVGt1WTYwN052TQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblRUa284R1ZfU2ZibU50bXlqT09WWVhKdmpzQXxBQ3Jtc0trS3huRTFKREc3MlEybEU5aVdxdHNRVWVsV3FDUUxTUzZZVUpQR2hBWUdoNDJsb0w4U0xVWU5nVG5uZEVxejgtMGhlYU96N00yMVBKT25xMWVUeGg5SGFfWlZ6QmR3NHRITkVETlBMVGt1WTYwN052TQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI97rS6sLZkAMVqkhIAB1mlyyHSOnD7pmTgvCiDcoBBAqMIUs=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXRUNm5wVkF1VkY0SnNRVmZoOXlUUTU2NUJiUXxBQ3Jtc0trY3FENFpWQzZMOC1VamVnVVZQaDJNUExtbElmV2VncVpYQmllSk5KeDhZZTBoZEhWOWN3Y2xKbjBlS19mS3QtNzlTWi1sUGdZMkI1ZGJ3M20xdi0xNDVTWWVPdkI1OHp6RTBsWVUwR1QxM0s3Y01RSQ\u0026q=https%3A%2F%2Fadolfoneto.elixiremfoco ibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwj3utLqwtmQAxWqSEgAHWaXLIdI6cPumZOC8KINygEECowhSw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbE9OaVpRRXdzdHIzekVIRzluY2QyMUZ2OGZWUXxBQ3Jtc0tsRVdxTEVUdW9oaS1NNHY1TzlfNGtyWmx0V3NycGI2UDY2UGtaUVktZ3E5NWJ4MHUzX1JnckhxeFJrOUtjNWZMWlVYSHFiSEhjTkNmeVhXQTdoYlZoVWRTNEx2S2l5ZEh4T283WUtBOVZDcm1CU3NSOA\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbE9OaVpRRXdzdHIzekVIRzluY2QyMUZ2OGZWUXxBQ3Jtc0tsRVdxTEVUdW9oaS1NNHY1TzlfNGtyWmx0V3NycGI2UDY2UGtaUVktZ3E5NWJ4MHUzX1JnckhxeFJrOUtjNWZMWlVYSHFiSEhjTkNmeVhXQTdoYlZoVWRTNEx2S2l5ZEh4T283WUtBOVZDcm1CU3NSOA\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwj3utLqwtmQAxWqSEgAHWaXLIdI6cPumZOC8KINygEECowhSw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVpDcktCOUtFNGRZenNWWmNHNi1PYlh0S1g2QXxBQ3Jtc0tudHpMVjJKSlNZWTY2bXdIc1BZbzFRc21OZEZsTi0xakc5V3VuSUtEQmw0LUx0Q0dzTzY2Znpjbi11NXg5cDhGYTVma3R5WnJOZjJXZ3ZneEN0czBfbFhmZlAyb2xqalpUOUotQ2hUOTQ0YmhRTVV1UQ\u0026q=https%3A%2F%2Fadolfoneto.elixiremfoco.com%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVpDcktCOUtFNGRZenNWWmNHN
